INSERT INTO "traits" VALUES('TFT16_Glutton','16.2','河流之王','origin','ASSETS/UX/TraitIcons/Trait_Icon_16_Glutton.TFT_Set16.tex','在每个备战阶段，你可以用一个弈子喂养【塔姆·肯奇】，基于被喂养弈子的角色定位和星级，为他永久提供生命值、攻击速度或法术加成中的一项。<br><br><tftitemrules>要喂养塔姆，只需要将备战区的一名友军悬停在塔姆上方，在他的嘴巴张开时松开即可。</tftitemrules><br>','[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"undefined":1.25}}]','{"apiName":"TFT16_Glutton","desc":"\u5728\u6bcf\u4e2a\u5907\u6218\u9636\u6bb5\uff0c\u4f60\u53ef\u4ee5\u7528\u4e00\u4e2a\u5f08\u5b50\u5582\u517b\u3010\u5854\u59c6\u00b7\u80af\u5947\u3011\uff0c\u57fa\u4e8e\u88ab\u5582\u517b\u5f08\u5b50\u7684\u89d2\u8272\u5b9a\u4f4d\u548c\u661f\u7ea7\uff0c\u4e3a\u4ed6\u6c38\u4e45\u63d0\u4f9b\u751f\u547d\u503c\u3001\u653b\u51fb\u901f\u5ea6\u6216\u6cd5\u672f\u52a0\u6210\u4e2d\u7684\u4e00\u9879\u3002<br><br><tftitemrules>\u8981\u5582\u517b\u5854\u59c6\uff0c\u53ea\u9700\u8981\u5c06\u5907\u6218\u533a\u7684\u4e00\u540d\u53cb\u519b\u60ac\u505c\u5728\u5854\u59c6\u4e0a\u65b9\uff0c\u5728\u4ed6\u7684\u5634\u5df4\u5f20\u5f00\u65f6\u677e\u5f00\u5373\u53ef\u3002</tftitemrules><br>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"undefined":1.25}}],"icon":"ASSETS/UX/TraitIcons/Trait_Icon_16_Glutton.TFT_Set16.tex","name":"\u6cb3\u6d41\u4e4b\u738b","org":{"desc":"\u5728\u6bcf\u4e2a\u5907\u6218\u9636\u6bb5\uff0c\u4f60\u53ef\u4ee5\u7528\u4e00\u4e2a\u5f08\u5b50\u5582\u517b\u3010\u5854\u59c6\u00b7\u80af\u5947\u3011\uff0c\u57fa\u4e8e\u88ab\u5582\u517b\u5f08\u5b50\u7684\u89d2\u8272\u5b9a\u4f4d\u548c\u661f\u7ea7\uff0c\u4e3a\u4ed6\u6c38\u4e45\u63d0\u4f9b\u751f\u547d\u503c\u3001\u653b\u51fb\u901f\u5ea6\u6216\u6cd5\u672f\u52a0\u6210\u4e2d\u7684\u4e00\u9879\u3002<br><br><tftitemrules>\u8981\u5582\u517b\u5854\u59c6\uff0c\u53ea\u9700\u8981\u5c06\u5907\u6218\u533a\u7684\u4e00\u540d\u53cb\u519b\u60ac\u505c\u5728\u5854\u59c6\u4e0a\u65b9\uff0c\u5728\u4ed6\u7684\u5634\u5df4\u5f20\u5f00\u65f6\u677e\u5f00\u5373\u53ef\u3002</tftitemrules><br><br>\u5f53\u524d\u5c5e\u6027\uff1a@TFTUnitProperty.:TFT16_GluttonSta