INSERT INTO "traits" VALUES('TFT16_Chronokeeper','16.2','时光守护者','origin','ASSETS/UX/TraitIcons/Trait_Icon_16_Chronokeeper.TFT_Set16.tex','每2次施放技能，【时光守护者】会储存<TFTBonus>1</TFTBonus>经验值。若储存的经验值足够你升级，他会传输给你所需的经验值。<br><br>若你已是10级，他转而获得<TFTBonus>15%</TFTBonus>伤害增幅。<br>','[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"CastsToGainXP":2,"CastsToGainXPPAIRS":2,"DAGainAtMaxLevel":15,"XPPerCast":1,"undefined":null}}]','{"apiName":"TFT16_Chronokeeper","desc":"\u6bcf2\u6b21\u65bd\u653e\u6280\u80fd\uff0c\u3010\u65f6\u5149\u5b88\u62a4\u8005\u3011\u4f1a\u50a8\u5b58<TFTBonus>1</TFTBonus>\u7ecf\u9a8c\u503c\u3002\u82e5\u50a8\u5b58\u7684\u7ecf\u9a8c\u503c\u8db3\u591f\u4f60\u5347\u7ea7\uff0c\u4ed6\u4f1a\u4f20\u8f93\u7ed9\u4f60\u6240\u9700\u7684\u7ecf\u9a8c\u503c\u3002<br><br>\u82e5\u4f60\u5df2\u662f10\u7ea7\uff0c\u4ed6\u8f6c\u800c\u83b7\u5f97<TFTBonus>15%</TFTBonus>\u4f24\u5bb3\u589e\u5e45\u3002<br>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"CastsToGainXP":2,"CastsToGainXPPAIRS":2,"DAGainAtMaxLevel":15,"XPPerCast":1,"undefined":null}}],"icon":"ASSETS/UX/TraitIcons/Trait_Icon_16_Chronokeeper.TFT_Set16.tex","name":"\u65f6\u5149\u5b88\u62a4\u8005","org":{"desc":"\u6bcf@CastsToGainXP@\u6b21\u65bd\u653e\u6280\u80fd\uff0c\u3010\u65f6\u5149\u5b88\u62a4\u8005\u3011\u4f1a\u50a8\u5b58<TFTBonus>@XPPerCast@</TFTBonus>\u7ecf\u9a8c\u503c\u3002\u82e5\u50a8\u5b58\u7684\u7ecf\u9a8c\u503c\u8db3\u591f\u4f60\u5347\u7ea7\uff0c\u4ed6\u4f1a\u4f20\u8f93\u7ed9\u4f60\u6240\u9700\u7684\u7ecf\u9a8c\u503c\u3002<br><br>\u82e5\u4f60\u5df2\u662f10\u7ea7\uff0c\u4ed6\u8f6c\u800c\u83b7\u5f97<TFTBonus>@DAGainAtMaxLevel@%</TFTBonus>\u4f24\u5bb3\u589e\u5e45\u3002<br><br><rules>\u5df2\u50a8\u5b58\u7684\u7ecf\u9a8c\u503c\uff1a@TFTUnitProperty.trait:TFT16_ChronoKeeperStoredXP@</rules>","effects":[{"maxUnits":25000,"minUnits":1,"style":4,"variables":{"CastsToGainXP":2,"CastsToGainXPPAIRS":2,"DAGainAtMaxLevel":15,"XPPerCast":1,"{bffe0f35}":null}}]},"_key":"TFT16_Chronokeeper","imageUrl":"https://c-